import * as React from 'react'
import { render } from '@testing-library/react'


const createButton = () => {

    function showForm(){
        return(
            <form>
                <input
                    placeholder="List Title"
                    type="text"
                />
            </form>
        )
    }

    return(
        <div>
            <button className="create-list-btn" onClick={showForm}>Create List</button>
            <form>
                <input
                    placeholder="List Title"
                    type="text"
                />
            </form>
        </div>
    )
}

export default createButton
